		margin: 0 5px 0 0;
		position: relative;
		border: 0;
		background-image: url(https://static.wanted.co.kr/images/userweb/checkbox.svg);
		background-size: cover;
		-webkit-appearance: none;
		:checked {
			background-image: url(https://static.wanted.co.kr/images/userweb/checkbox_.svg);
		}
	}

	.sortableitem-container {
		margin: 0;
		padding: 30px;
		position: relative;
		border-radius: 0;
		border: none;
		border-bottom: 1px solid #f1f1f1;
		background-color: transparent;
	}
	.draghandler {
		position: absolute;
		cursor: move;
		display: none;
		top: 35px;
		left: 10px;
	}
	.period-form-end {
		display: inline-block;
	}
	.datetiem-isrequired {
		color: #fe415c;
	}
	.resumeInput-container {
		font-family: inherit;
		font-size: 16px;
	}
	.careeritem-container {
		display: flex;
		flex-direction: row;
		> div:first-of-type {
			flex: 3 1;
