		}
	}
	.searchmodalinput-input {
		color: #ccc !important;
		font-size: 26px;
		font-weight: 600;
		text-overflow: ellipsis;
		overflow: hidden;
		border: none;
		padding: 0;
		margin-bottom: 5px;
		border-radius: 0;
		::placeholder {
			color: #ccc !important;
			font-size: 20px;
		}
	}
	.btn-delete {
		position: absolute;
		color: #d1d1d1;
		font-size: 10px;
		padding: 15px;
		border: 0;
		background-color: transparent;
		top: 21px;
		right: 15px;
	}
	.period-datetime {
		position: relative;
	}
