		padding: 0;
		border: none;
		border-radius: 0;
		font-size: 14px;
		font-weight: 500;
		background-color: transparent;
		box-shadow: none !important;
		-webkit-appearance: none;
		resize: none;
		.month {
			width: 26px;
			margin-left: 4px;
		}
		.year {
			width: 36px;
		}
	}

	.resumecontentlist-body-container {
		font-size: 16px;
		padding: 20px 0;
		font-weight: 600;
		text-align: left;
		font-family: inherit;
		color: #36f;
		background-color: transparent;
	}

	.period-checkbox {
		margin: 16px 0 30px;
		display: flex;
		align-items: flex-start;
		color: rgba(0, 0, 0, 0.4);
		font-size: 14px;
		font-weight: 600;
	}
`;
export default ResumeCareer;
